import{_ as n,c as o,o as i,d as r}from"./app.1feda514.js";const c="/SessionAPI/assets/multi-layer.6544c7fd.png",t="/SessionAPI/assets/grouping-step1.7e2d86cb.png",s="/SessionAPI/assets/grouping-step2.a137f3e8.png",d="/SessionAPI/assets/grouping-done.418e0e03.png",l="/SessionAPI/assets/generalization-specialization.a31f38ae.png",p="/SessionAPI/assets/example-specialization.b2e1d948.png",e="/SessionAPI/assets/specialization-execution.e6dac0e3.png",a="/SessionAPI/assets/generalization-execution.6e79086a.png",b=JSON.parse('{"title":"Zdarzenia w zagnie\u017Cd\u017Conych drzewach komponent\xF3w","description":"","frontmatter":{},"headers":[{"level":2,"title":"Grupowanie komponent\xF3w (Generalizacja-Specyfikacja)","slug":"grupowanie-komponentow-generalizacja-specyfikacja","link":"#grupowanie-komponentow-generalizacja-specyfikacja","children":[{"level":3,"title":"Pierwszy krok grupowania:","slug":"pierwszy-krok-grupowania","link":"#pierwszy-krok-grupowania","children":[]},{"level":3,"title":"Drugi krok grupowania:","slug":"drugi-krok-grupowania","link":"#drugi-krok-grupowania","children":[]},{"level":3,"title":"Uko\u0144czone grupowanie:","slug":"ukonczone-grupowanie","link":"#ukonczone-grupowanie","children":[]}]},{"level":2,"title":"Generalizacji-specyfikacja","slug":"generalizacji-specyfikacja","link":"#generalizacji-specyfikacja","children":[]},{"level":2,"title":"Uruchamianie komponent\xF3w: onComponentInit oraz onPlayerInit","slug":"uruchamianie-komponentow-oncomponentinit-oraz-onplayerinit","link":"#uruchamianie-komponentow-oncomponentinit-oraz-onplayerinit","children":[{"level":3,"title":"Proces inicjalizacji","slug":"proces-inicjalizacji","link":"#proces-inicjalizacji","children":[]}]},{"level":2,"title":"Wy\u0142\u0105czanie komponent\xF3w: onPlayerDestroy oraz onComponentDestroy","slug":"wy\u0142aczanie-komponentow-onplayerdestroy-oraz-oncomponentdestroy","link":"#wy\u0142aczanie-komponentow-onplayerdestroy-oraz-oncomponentdestroy","children":[]},{"level":2,"title":"Dodawanie gracza do sesji","slug":"dodawanie-gracza-do-sesji","link":"#dodawanie-gracza-do-sesji","children":[]},{"level":2,"title":"Usuwanie gracza z sesji","slug":"usuwanie-gracza-z-sesji","link":"#usuwanie-gracza-z-sesji","children":[]},{"level":2,"title":"Modyfikacja drzewa w czasie rzeczywistym","slug":"modyfikacja-drzewa-w-czasie-rzeczywistym","link":"#modyfikacja-drzewa-w-czasie-rzeczywistym","children":[{"level":3,"title":"Uruchamianie nowych fragment\xF3w drzewa","slug":"uruchamianie-nowych-fragmentow-drzewa","link":"#uruchamianie-nowych-fragmentow-drzewa","children":[]},{"level":3,"title":"Wy\u0142\u0105czanie fragment\xF3w drzewa","slug":"wy\u0142aczanie-fragmentow-drzewa","link":"#wy\u0142aczanie-fragmentow-drzewa","children":[]}]}],"relativePath":"pl/technical/nested-trees.md"}'),z={name:"pl/technical/nested-trees.md"},w=r('<h1 id="zdarzenia-w-zagniezdzonych-drzewach-komponentow" tabindex="-1">Zdarzenia w zagnie\u017Cd\u017Conych drzewach komponent\xF3w <a class="header-anchor" href="#zdarzenia-w-zagniezdzonych-drzewach-komponentow" aria-hidden="true">#</a></h1><p>Drzewo komponent\xF3w powstaje na skutek rekurencyjnego uruchamiania dzieci przez komponenty nadrz\u0119dne.</p><p><img src="'+c+'" alt="drzewo zagnie\u017Cd\u017Cone"></p><details><summary>Fragment wykonywania</summary><ul><li><strong>0</strong> uruchamia <code>1</code></li><li><strong>1</strong> <em>nie uruchamia nic</em></li><li><strong>0</strong> uruchamia <code>2</code></li><li><strong>2</strong> uruchamia <code>3</code></li><li><strong>3</strong> uruchamia <code>4</code></li><li><strong>4</strong> <em>nie uruchamia nic</em></li><li><strong>0</strong> uruchamia <code>5</code></li><li>...</li></ul></details><p>Pomimo \u017Ce komponent <strong>0</strong> chcia\u0142by uruchomi\u0107 wszystkie komponenty z <code>Layer 1</code> jednocze\u015Bnie, inicjalizacja odbywa si\u0119 w spos\xF3b rekurencyjny \u2013 ka\u017Cdy komponent mo\u017Ce wyzwala\u0107 kolejne.</p><h2 id="grupowanie-komponentow-generalizacja-specyfikacja" tabindex="-1">Grupowanie komponent\xF3w (Generalizacja-Specyfikacja) <a class="header-anchor" href="#grupowanie-komponentow-generalizacja-specyfikacja" aria-hidden="true">#</a></h2><p>Kolejno\u015B\u0107 przetwarzania zdarze\u0144 wewn\u0119trznych zale\u017Cy od indeksu klastra, do kt\xF3rego trafi\u0142 komponent, oraz jego pozycji w tym klastrze.</p><h3 id="pierwszy-krok-grupowania" tabindex="-1">Pierwszy krok grupowania: <a class="header-anchor" href="#pierwszy-krok-grupowania" aria-hidden="true">#</a></h3><p><img src="'+t+'" alt="pierwszy krok grupowania"></p><h3 id="drugi-krok-grupowania" tabindex="-1">Drugi krok grupowania: <a class="header-anchor" href="#drugi-krok-grupowania" aria-hidden="true">#</a></h3><p><img src="'+s+'" alt="drugi krok grupowania"></p><h3 id="ukonczone-grupowanie" tabindex="-1">Uko\u0144czone grupowanie: <a class="header-anchor" href="#ukonczone-grupowanie" aria-hidden="true">#</a></h3><p>Dla ka\u017Cdego komponentu, kt\xF3ry nic nie uruchamia, tworzony jest klaster. Algorytm schodzi w d\xF3\u0142 i przypisuje ka\u017Cdego nadrz\u0119dnego komponentu do klastra, je\u015Bli nie zosta\u0142 jeszcze przyporz\u0105dkowany. <img src="'+d+'" alt="koniec grupowani"></p><h2 id="generalizacji-specyfikacja" tabindex="-1">Generalizacji-specyfikacja <a class="header-anchor" href="#generalizacji-specyfikacja" aria-hidden="true">#</a></h2><p>Generalizacja i specjalizacja okre\u015Blaj\u0105 kierunek wykonywania operacji w strukturze drzewa.</p><ul><li><strong>Specjalizacja</strong> \u2013 przetwarzanie w g\xF3r\u0119 drzewa, od og\xF3lnych komponent\xF3w do bardziej szczeg\xF3\u0142owych.</li><li><strong>Generalizacja</strong> \u2013 przetwarzanie w g\u0142\u0105b drzewa, od komponent\xF3w szczeg\xF3\u0142owych do bardziej og\xF3lnych.</li></ul><p><img src="'+l+'" alt="generalizacja-specyfikacja"></p><p><img src="'+p+'" alt="specyfikacji"></p><h2 id="uruchamianie-komponentow-oncomponentinit-oraz-onplayerinit" tabindex="-1">Uruchamianie komponent\xF3w: <code>onComponentInit</code> oraz <code>onPlayerInit</code> <a class="header-anchor" href="#uruchamianie-komponentow-oncomponentinit-oraz-onplayerinit" aria-hidden="true">#</a></h2><p>Inicjalizacja komponent\xF3w odbywa si\u0119 w kierunku <strong>specjalizacji</strong>.</p><p><img src="'+e+'" alt="grupowanie sp\u0142aszczone"></p><h3 id="proces-inicjalizacji" tabindex="-1">Proces inicjalizacji <a class="header-anchor" href="#proces-inicjalizacji" aria-hidden="true">#</a></h3><ul><li>Przechodzimy przez wszystkie klastry i ka\u017Cdy komponent w klastrze.</li><li>Uruchamiamy <code>onComponentInit</code> dla ka\u017Cdego komponentu.</li><li>Po zako\u0144czeniu, powtarzemy operacj\u0119, uruchamiaj\u0105c <code>onPlayerInit</code> dla ka\u017Cdego komponentu i gracza.</li></ul><div class="tip custom-block"><p class="custom-block-title">Zasada cyklu \u017Cycia komponentu</p><ol><li>Tworzymy zasoby \u2192 <code>onComponentInit</code></li><li>Dodajemy stan graczy \u2192 <code>onPlayerInit</code></li></ol></div><details><summary>Fragment wykonywania</summary><p><strong>Klaster 1:</strong></p><ul><li><strong>0:</strong> <code>onComponentInit</code></li><li><strong>1:</strong> <code>onComponentInit</code></li><li><strong>0:</strong> <code>onPlayerInit</code></li><li><strong>1:</strong> <code>onPlayerInit</code></li></ul><p><strong>Klaster 2:</strong></p><ul><li><strong>2:</strong> <code>onComponentInit</code></li><li><strong>3:</strong> <code>onComponentInit</code></li><li><strong>4:</strong> <code>onComponentInit</code></li><li><strong>2:</strong> <code>onPlayerInit</code></li><li><strong>3:</strong> <code>onPlayerInit</code></li><li><strong>4:</strong> <code>onPlayerInit</code></li></ul><p><strong>Klaster 3:</strong></p><ul><li>...</li></ul></details><h2 id="wy\u0142aczanie-komponentow-onplayerdestroy-oraz-oncomponentdestroy" tabindex="-1">Wy\u0142\u0105czanie komponent\xF3w: <code>onPlayerDestroy</code> oraz <code>onComponentDestroy</code> <a class="header-anchor" href="#wy\u0142aczanie-komponentow-onplayerdestroy-oraz-oncomponentdestroy" aria-hidden="true">#</a></h2><p>Wy\u0142\u0105czanie komponent\xF3w odbywa si\u0119 w kierunku <strong>generalizacji</strong>, czyli odwrotnie do inicjalizacji.</p><p><img src="'+a+'" alt="wykonywanie w kierunku generalizacji"></p><div class="tip custom-block"><p class="custom-block-title">Zasada cyklu \u017Cycia komponentu</p><ol><li>Usuwamy stan graczy \u2192 <code>onPlayerDestroy</code></li><li>Niszczymy zasoby \u2192 <code>onComponentDestroy</code></li></ol></div><h2 id="dodawanie-gracza-do-sesji" tabindex="-1">Dodawanie gracza do sesji <a class="header-anchor" href="#dodawanie-gracza-do-sesji" aria-hidden="true">#</a></h2><p>Dodawanie gracza do sesji odbywa si\u0119 w kierunku <strong>specjalizacji</strong>. <img src="'+e+'" alt="grupowanie sp\u0142aszczone"></p><h2 id="usuwanie-gracza-z-sesji" tabindex="-1">Usuwanie gracza z sesji <a class="header-anchor" href="#usuwanie-gracza-z-sesji" aria-hidden="true">#</a></h2><p>Usuwanie gracza z sesji odbywa si\u0119 w kierunku <strong>generalizacji</strong>. <img src="'+a+'" alt="wykonywanie w kierunku generalizacji"></p><h2 id="modyfikacja-drzewa-w-czasie-rzeczywistym" tabindex="-1">Modyfikacja drzewa w czasie rzeczywistym <a class="header-anchor" href="#modyfikacja-drzewa-w-czasie-rzeczywistym" aria-hidden="true">#</a></h2><p>Drzewo komponent\xF3w jest dynamiczne. W trakcie dzia\u0142ania sesji mo\u017Cemy uruchamia\u0107 i wy\u0142\u0105cza\u0107 komponenty lub fragmenty drzewa.</p><h3 id="uruchamianie-nowych-fragmentow-drzewa" tabindex="-1">Uruchamianie nowych fragment\xF3w drzewa <a class="header-anchor" href="#uruchamianie-nowych-fragmentow-drzewa" aria-hidden="true">#</a></h3><p>Je\u015Bli do\u0142\u0105czymy nowe komponenty w trakcie dzia\u0142ania, zostan\u0105 one uruchomione zgodnie z algorytmem <code>Uruchamianie komponent\xF3w</code>, ale tylko w obr\u0119bie nowej ga\u0142\u0119zi drzewa. Zdarzenia b\u0119d\u0105 wykonywane w kierunku <strong>specjalizacji</strong>.</p><h3 id="wy\u0142aczanie-fragmentow-drzewa" tabindex="-1">Wy\u0142\u0105czanie fragment\xF3w drzewa <a class="header-anchor" href="#wy\u0142aczanie-fragmentow-drzewa" aria-hidden="true">#</a></h3><p>Je\u015Bli wy\u0142\u0105czamy komponent posiadaj\u0105cy komponenty podrz\u0119dne, zostanie uruchomiony algorytm <code>Wy\u0142\u0105czanie komponent\xF3w</code>, ale tylko w obr\u0119bie danej ga\u0142\u0119zi drzewa. Algorytm wy\u0142\u0105czy komponent oraz wszystkie jego komponenty podrz\u0119dne. Operacje te b\u0119d\u0105 wykonywane w kierunku <strong>generalizacji</strong>.</p>',39),g=[w];function u(y,m,k,h,j,f){return i(),o("div",null,g)}const P=n(z,[["render",u]]);export{b as __pageData,P as default};
